import axios from 'axios'

const url = process.env.REACT_APP_URL_BASE;

/* Obtiene la data de movimientos de tikets entre tiendas */
export const getCollaboration = () => {
    return axios
        .get(url + '/collaborator/get')
        .then((response) => {
            return res.json({response})
        })
        .catch((error) => {
            //console.log(error);
        })
}
